import React, { Component } from 'react';
import { Nav } from 'reactstrap';
import './LeftBar.css';

export default class LeftBar extends Component {
   setTheme(theme) {
      if (theme === 'dark') {
         return 'navbar-dark bg-dark';
      }
      if (theme === 'light') {
         return 'navbar-light bg-light';
      } else {
         return 'navbar-light bg-light';
      }
   }

   render() {
      return (
         <Nav
            vertical
            pills
            className={`${this.setTheme(this.props.theme)} leftbar`}
         >
            {this.props.children}
         </Nav>
      );
   }
}
